-- Creando PERSONAS
CREATE TABLE personas (
   n_id_organ NUMBER(12),
   c_dni NUMBER(13),
   c_apell VARCHAR2(100),
   c_nombre VARCHAR2(100),
   c_email varchar(100),
   n_id_ubigeo NUMBER(12),
   c_telefono VARCHAR2(50),
   cel VARCHAR2(50),
   cargo VARCHAR2(100),
   CONSTRAINT personas_pk PRIMARY KEY(c_dni),
   CONSTRAINT per_ubi_fk FOREIGN KEY (n_id_ubigeo) REFERENCES ubigeo(n_id_ubigeo),
   CONSTRAINT per_ent_fk FOREIGN KEY (n_id_organ) REFERENCES entidad(n_id_organ)
);



select * from personas;